import "./Card.css";

function Card(props) {
  return (
    <div>
      <div className="card">
        <h1 className="h1">{props.name}</h1>
        <div>{props.age}</div>
        <div>{props.city}</div>

        <div>{props.title}</div>
        <div>{props.date}</div>
        <div>{props.soz}</div>

        <div>{props.name1}</div>
        <div>{props.age1}</div>
        <div>{props.city1}</div>
      </div>
    </div>
  );
}
export default Card;
